import React from 'react';
import SongCard from './SongCard';
import { withRouter } from 'react-router-dom';
//withRouter gives the app the props
class SongList extends React.Component{
  state = {
    songs: []
  }


// https://api.napster.com/v2.2/playlists/pp.225974698/tracks?apikey=MTU1YjllNjUtOTIwNi00MGJlLWJlOWMtZGYxMjJhZDI0NTk5
  componentDidMount = () => {
    const apiKey = '?apikey=MTU1YjllNjUtOTIwNi00MGJlLWJlOWMtZGYxMjJhZDI0NTk5&limit=5';
    const href = this.props.currentPlaylist.links.tracks.href
    const url = `${href}${apiKey}`
    console.log('URL THAT IM GETTING',url);
    url
      ? fetch(url)
      .then(resp => resp.json())
      .then(console.log)
      : console.log('hi');
  }

  render(){
    console.log("SongList", this.props);
    return(
      <div>
      <h1>Song List</h1>
      </div>
    )
  }
}

export default withRouter(SongList);
